import React from "react";
import './Logo.css';
import logoImage from '../mage/logo.jpg';


const Logo = () => {
  return (
      <div className="container-fluid">
        <h1>FAMILY MARKET</h1>
        <img src={logoImage} alt="Logo" className="logo-image" />

      </div>
  );
}
export default Logo;
